  summary: "\n Read timestamp this batch was returned from.\n This applies to the range of results from the query's <code>start_cursor</code> (or\n the beginning of the query if no cursor was given) to this batch's\n <code>end_cursor</code> (not the query's <code>end_cursor</code>).\n\n In a single transaction, subsequent query result batches for the same query\n can have a greater timestamp. Each batch's read timestamp\n is valid for all preceding batches.\n This value will not be set for eventually consistent queries in Cloud\n Datastore.\n \n\n <code>.google.protobuf.Timestamp read_time = 8;</code>"
  syntax:
    content: "public abstract Timestamp getReadTime()"
    return:
      type: "com.google.protobuf.Timestamp"
